import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { Box, Typography, TextField, Button } from "@mui/material";

const SignUpSecurity: React.FC = () => {
    const navigate = useNavigate();
    const [q1, setQ1] = useState("");
    const [q2, setQ2] = useState("");

    const handleNext = () => {
        // TODO: Save security answers to backend
        navigate("/signin");
    };

    return (
        <Box textAlign="center" mt={5}>
            <Typography variant="h4">Security Questions</Typography>
            <TextField label="Question 1 Answer" value={q1} onChange={(e) => setQ1(e.target.value)} fullWidth sx={{ my: 1 }} />
            <TextField label="Question 2 Answer" value={q2} onChange={(e) => setQ2(e.target.value)} fullWidth sx={{ my: 1 }} />
            <Button variant="contained" sx={{ mt: 3 }} onClick={handleNext}>Finish Signup</Button>
        </Box>
    );
};

export default SignUpSecurity;
